import React, { useState } from "react";
import { Radio } from "antd";
import "./DLogin.css";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import { Drawer } from "antd";

const Login = () => {
    return (
        <>
        <ToastContainer />

        <div className="mainLoginPage">
            <div className="leftside">
            {/* <img src={banner} alt="banner" /> */}
            </div>
            <div className="rightside">
            <h1>Login</h1>
            <div>
                <Radio.Group
                value={placement}
                onChange={placementChange}
                className={"radiogroup"}
                >
                <Radio.Button value="Nurse" className={"radiobutton"}>
                    Nurse
                </Radio.Button>
                <Radio.Button value="Doctor" className={"radiobutton"}>
                    Doctor
                </Radio.Button>
                <Radio.Button value="Admin" className={"radiobutton"}>
                    Admin
                </Radio.Button>
                </Radio.Group>
            </div>
            <div className="Profileimg">
                {/* <img src={admin} alt="profile" /> */}
            </div>
            <div>
                <p>ID - 100</p>
                <p>Password - masai</p>
                <form onSubmit={HandleSubmit}>
                <h3>{placement} ID</h3>
                <input
                    type="number"
                    name="ID"
                    value={formvalue.ID}
                    // onChange={Handlechange}
                    required
                />
                <h3>Password</h3>
                <input
                    type="password"
                    name="password"
                    value={formvalue.password}
                    onChange={Handlechange}
                    required
                />
                <button type="submit">{Loading ? "Loading..." : "Submit"}</button>
                <p style={{ marginTop: "10px" }}>
                    Forget Password?{" "}
                    <span
                    style={{ color: "blue", cursor: "pointer" }}
                    // onClick={showDrawer}
                    >
                    Get it on Email !
                    </span>
                </p>

                {/* ********************************************************* */}
                <Drawer
                    title="Forget Password"
                    placement="left"
                    onClose={onClose}
                    open={open}
                >
                    <div>
                    <label style={{ fontSize: "18px" }}>Choose Type</label>

                    <select
                        name="type"
                        value={ForgetPassword.type}
                        // onChange={HandleForgetPassword}
                        required
                    >
                        <option value="">User Type</option>
                        <option value="nurse">Nurse</option>
                        <option value="doctor">Doctor</option>
                        <option value="admin">Admin</option>
                    </select>
                    </div>
                    <div>
                    <label style={{ display: "block", fontSize: "18px" }}>
                        Enter Email
                    </label>
                    <input
                        type="email"
                        placeholder="example@mail.com"
                        name="email"
                        value={ForgetPassword.email}
                        onChange={HandleForgetPassword}
                        required
                        style={{
                        width: "100%",
                        height: "3rem",
                        borderRadius: "5px",
                        border: "none",
                        backgroundColor: "#bce0fb",
                        fontSize: "18px",
                        marginTop: "10px",
                        paddingLeft: "10px",
                        }}
                    />
                    </div>

                    <button
                    style={{
                        width: "50%",
                        margin: " 20px auto",
                        display: "flex",
                        padding: "10px",
                        fontSize: "18px",
                        backgroundColor: "#ff9f9f",
                        border: "none",
                        borderRadius: "7px",
                        cursor: "pointer",
                        justifyContent: "center",
                    }}
                    // onClick={HandleChangePassword}
                    >
                    {/* {forgetLoading ? "Loading..." : " Send Mail"} */}
                    </button>
                </Drawer>
                </form>
            </div>
            </div>
        </div>
        </>
    );
    };

export default Login;
